import React from 'react';

const Students = ({ students}) => {
  const renderStudents = students.map((student, index)=><div> <li key={index}>{student.name}</li></div>)
  return (
  <div>
    <h1>Students </h1>
    {students.map((student, index)=> (
        <div key={index}>
          <li>
            <h3> Name: {student.name}</h3>
            <p>Age: {student.age}</p>
            <p>Gender: {student.gender}</p>
          </li>
        </div>
      ))}
  </div>
)};

export default Students;
